import React from 'react';
import './App.css';

function App() {
  //console.log(fetch(`https://svc.metrotransit.org/nextripv2/routes`));
  fetch(`https://svc.metrotransit.org/nextripv2/routes`).then((response) => {
    console.log(response.json())
    return response.json();
  })
  return (
    <div className="App">
      <select className="select-box">
        <option>Select</option>
      </select>
    </div>
  );
}

export default App;
